import React from 'react';
import BootstrapTable from 'react-bootstrap-table-next';

const products = [(2,"mokasyny",241),
                  (4,"mokasyny",241) ];
//const products = [ ];

const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];



function addProducts(quantity) {
  const startId = products.length;
  for (let i = 0; i < quantity; i++) {
    const id = startId + i;
    products.push({
      id: id,
      name: 'Item name ' + id,
      price: 2100 + i
    });
  }
}

//addProducts(5);


export default () =>
  <BootstrapTable keyField='id' data={products} columns={ columns } />
